sources.styles/base.scss:
body {
  font-family: $primary-font;
  font-size: $primary-font-size;
  font-weight: $primary-font-weight;
  color: $text-color;
  background-color: $secondary-color;
}

a {
  color: $text-color;
  text-decoration: none;
  transition: color 0.35s ease;

  &:visited {
    color: $text-color;
  }

  &:hover {
    color: $link-hover-color;
  }
}

input[type="text"],
input[type="email"] {
  background-color: transparent;
  border: none;
  outline: none;
  width: 100%;
  height: 100%;
  padding: 0 26px;
  color: $primary-color;
  font-weight: 500;
  font-size: 16px;
  line-height: 20px;


  &::placeholder {
    font-weight: 500;
    font-size: 16px;
    line-height: 20px;
    opacity: 0.5;
  }
}

.form_field {
  width: 100%;
  height: 56px;
  margin-bottom: 18px;
  border-bottom: 1px solid $primary-color;
  position: relative;

  &:last-child {
    margin-bottom: 0;
  }

  &::after,
  &::before {
    content: '';
    position: absolute;
    width: 1px;
    height: 15px;
    background-color: $primary-color;
    bottom: -1px;
  }

  span {
    margin-top: 8px;
    font-size: 14px;
  }
}

button {
  color: $primary-color;
  transition: all 0.35s ease;
  &:hover {
    color: #fff;
  }
}

@keyframes showItem {
  from {
    opacity: 0;
    transform: translateY(20px);
  } 
  to {
    opacity: 1;
    transform: translateY(0);
  }
}

@keyframes fadeIn {
  from {
    opacity: 0;
  }
  to {
    opacity: 1;
  }
}

sources.styles/components/header.scss:
.header {
  height: 72px;
  border-bottom: 1px solid #A19D92;
  position: relative;
  z-index: 100;

  @include for-tablet {
    height: 62px;
  }

  .container {
    display: flex;
    align-items: center;
    max-width: 1700px;
    height: 100%;
  }

  &.active {
    .header_nav {
      transform: translate3d(0, 0, 0);
    }

    .header_burger {
      span {
        background-color: transparent;

        &::before {
          top: 0;
          transform: rotate(-135deg);
        }

        &::after {
          top: 0;
          transform: rotate(135deg);
        }
      }
    }
  }

  &_burger {
    height: 100%;
    display: none;
    cursor: pointer;

    span {
      display: block;
      width: 20px;
      height: 2px;
      background-color: $primary-color;
      position: relative;
      transition: all 0.3s;

      &::after,
      &::before {
        content: '';
        width: 100%;
        height: 100%;
        display: block;
        position: absolute;
        background-color: $primary-color;
        transition: all 0.4s ease-out;
      }

      &::before {
        top: -6px;
      }

      &::after {
        top: 6px;
      }
    }

    @include for-tablet {
      display: flex;
      align-items: center;
      width: 15%;
    }
  }

  &_nav {
    width: 33.33%;
    height: 100%;
    &_first {
      display: flex;
      li {
        margin-right: 50px;

        @include for-laptop {
          margin-right: 35px;
        }

        @include for-tablet {
          position: relative;
          padding: 26px 20px;
          margin-right: 0;

          &::after {
            content: '';
            width: calc(100% - 40px);
            height: 1px;
            background-color: rgba(255, 255, 255, 0.1);
            position: absolute;
            left: 20px;
            bottom: 0;
          }
        }

        &:last-child {
          margin-right: 0;
        }
      }
    }

    a {
      font-weight: 500;
      line-height: 22px;
    }

    @include for-tablet {
      position: fixed;
      overflow-y: scroll;
      -webkit-overflow-scrolling: touch;
      max-width: 450px;
      width: 100%;
      top: 62px;
      left: 0;
      bottom: 0;
      background-color: $primary-color;
      padding: 0;
      transition: transform 0.4s cubic-bezier(0.645, 0.045, 0.355, 1);
      transform: translate3d(-100%, 0, 0);

      a {
        font-size: 24px;
        font-weight: 700;
        margin-right: 0;
        color: #fff;
      }
    }

    &_first {
      position: relative;
      height: 100%;

      li {
        height: 100%;
        display: flex;
        justify-content: center;
        align-items: center;
        &:hover {
          .header_nav_second {
            transform: scaleY(1)
          }
        }

        @include for-tablet {
          height: auto;
          align-items: flex-start;
          flex-direction: column;
          position: relative;
        }
      }

      @include for-tablet {
        height: 100vh;
        flex-direction: column;
      }
    }

    &_second {
      width: max-content;
      display: flex;
      flex-direction: column;
      align-items: flex-start;
      position: absolute;
      background-color: $primary-color;
      top: 100%;
      left: 0;
      transition: all 0.4s ease;
      transform-origin: top;
      transform: scaleY(0);
      z-index: 100;
      li {
        padding: 15px; 

        a {
          color: #fff;
        }
      }

      + .sub_menu_btn {
        display: none;
        transition: transform 0.4s ease;
        transform: scale(1);
        z-index: 100;

        svg {
          transition: transform 0.2s ease;
        }
      }

      &.open {
        padding-top: 18px;

        + .sub_menu_btn {
          transform: scale(-1);
          svg {
            transform: translateY(-3px);
          }

        }
      }

      @include for-tablet {
        width: 100%;
        position: relative;
        transform: scale(1);
        padding: 0;
        top: 0;
        height: 0;
        overflow-x: hidden;

        a {
          font-size: 18px;
          font-weight: 500;
          line-height: 22px;
        }

        li {
          padding: 10px 0;
          &::after {
            display: none;
          }
        }
        + .sub_menu_btn {
          display: block;
          width: 40px;
          height: 40px;
          display: flex;
          justify-content: center;
          align-items: center;
          border: 1px solid rgba(255, 255, 255, 0.1);
          position: absolute;
          top: 18px;
          right: 20px;
        }
      }
    }
  }

  &_logo {
    width: 33.33%;
    font-size: 28px;
    line-height: 34px;
    text-align: center;

    a:hover {
      color: $primary-color;
    }

    @include for-tablet {
      flex-shrink: 0;
      width: 70%;
      font-weight: 700;
    }
  }

  &_social {
    width: 33.33%;
    display: flex;
    justify-content: flex-end;


    a {
      width: 40px;
      height: 40px;
      display: flex;
      justify-content: flex-end;
      align-items: center;

      &:hover {

        svg,
        path {
          fill: #fff
        }
      }
    }

    svg,
    path {
      transition: all 0.4s ease;
    }



    @include for-tablet {
      width: 15%;
    }
  }
}

sources.styles/components/categories.scss:
.categories {
  height: calc(100vh - 72px);
  min-height: 700px;

  @include for-tablet {
    height: calc(100vh - 62px);
  }

  @include for-phone {
    height: auto;
    padding: 50px 0 50px;
    min-height: auto;
    text-align: center;
  }

  .container {
    height: 100%;
    display: flex;
    justify-content: center;
    align-items: center;
  }

  &_wrapper {
    text-align: center;
    position: relative;
  }

  &_hover_img {
    position: fixed;
    top: 0;
    left: 0;
    z-index: -1;
    transition: all 0.65s linear;
    // transform: translate3d(0,0,0);
    // transform-origin: center;
    // will-change: transform;

    img {
      max-height: 310px;
      max-width: 466px;
      width: auto;
      position: absolute;
      transition: opacity 0.4s linear;
      transform: translate3d(-50%, -50%, 0);
      opacity: 0;
      pointer-events: none;

      &.show {
        opacity: 1;
      }
    }
  }

  &_item {
    font-family: $secondary-font;
    font-size: 76px;
    line-height: 88px;
    margin-bottom: 72px;
    opacity: 0;

    h3 {
      display: inline;
    }

    &:last-child {
      margin-bottom: 0;
    }

    @include for-tablet {
      font-size: 50px;
      line-height: 64px;
      margin-bottom: 40px;
    }

    @include for-phone {
      font-size: 38px;
      line-height: 54px;
      margin-bottom: 40px;
    }

    &.not_available a {
      color: rgba(67, 45, 47, 0.15);
      display: flex;
      flex-direction: column;
      pointer-events: none;

      &::after {
        content: "Coming Soon";
        font-weight: 500;
        font-size: 16px;
        line-height: 20px;
        color: $primary-color;
        font-family: $primary-font;

        @include for-phone {
          font-size: 14px;
          line-height: 17px;
        }
      }
    }
  }

  &.showed {
    .categories_item {
      animation: showItem 1s 0.5s ease both;
      @for $i from 1 through 10 {
        &:nth-child(#{$i}) {
          animation-delay: $i * 0.3s;
        }
      }
    }
  }
}

sources.styles/components/gallery.scss:
.gallery {
  &_categories {
    display: flex;
    flex-direction: column;
    justify-content: center;
    font-family: $secondary-font;
    position: fixed;
    top: calc(140px + 72px);
    margin: auto;
    font-size: 40px;
    line-height: 48px;
    max-width: 23%;

    &.showed {
      .gallery_categories_item {
        animation: showItem 1s 0.5s ease both;
        @for $i from 1 through 10 {
          &:nth-child(#{$i}) {
            animation-delay: $i * 0.3s;
          }
        }
      }
    }

    &_item {
      margin-bottom: 50px;

      &:last-child {
        margin-bottom: 0;
      }

      &.active {
        a {
          opacity: 0.15;
          cursor: not-allowed;
          &:hover {
            color: $primary-color;
            &::after {
              display: none;
            }
          }
        }
      }

      a {
        position: relative;

        &::after {
          content: '';
          width: 0px;
          height: 2px;
          background-color: #fff;
          position: absolute;
          left: 0;
          bottom: 0;
          transition: all 0.35s ease;
        }

        &:hover {
          &::after {
            width: 100%;
          }
        }
      }

      @include for-laptop {
        margin-bottom: 30px;
      }
    }

    @include for-tablet {
      display: none;
    }
  }

  &_wrapper {
    margin: 0 auto;
    max-width: 49%;
    padding: 48px 0;

    @include for-tablet {
      max-width: 75%;
    }

    @include for-phone {
      max-width: 100%;
      padding: 20px 0;
    }
  }

  &_category {
    &_title {
      font-family: $secondary-font;
      text-align: center;
      font-size: 60px;
      line-height: 72px;
      margin-bottom: 30px;

      @include for-phone {
        font-size: 36px;
        line-height: 43px;
      }
      &:not(.showed) {
        opacity: 0;
      }

      &.showed {
        animation: showItem 1s 0.5s ease both;
      }
    }

    &_item {
      margin-bottom: 70px;

      &.active.showed {
        animation: showItem 1s 0.5s ease both;
      }

      &:not(.active) {
        display: none;
      }
      &_params {
        display: none;
      }

      &_img {
        margin-bottom: 18px;
        display: flex;
        justify-content: center;
        cursor: pointer;

        img {
          align-self: auto;
        }

        @include for-phone {
          margin-bottom: 0;
        }
      }

      &_description {
        display: flex;

        @include for-phone {
          flex-direction: column-reverse;
        }
      }

      &_text {
        * {
          font-size: 18px;
          line-height: 31px;
        }
      }

      &_status {
        display: flex;
        justify-content: center;
        align-items: center;
        flex-shrink: 0;
        width: 145px;
        height: 37px;
        margin-left: 100px;
        text-align: center;
        border: 1px solid $primary-color;
        cursor: default;


        &.available {
          color: #fff;
          background-color: $primary-color;
        }

        @include for-laptop {
          margin-left: 30px;
        }

        @include for-phone {
          margin: 10px 0;
          width: 100%;
        }
      }

      @include for-phone {
        margin-bottom: 35px;
      }
    }
  }
}

.gallery_slider {
  position: fixed;
  top: 0;
  right: 0;
  left: 0;
  bottom: 0;
  width: 100%;
  height: 100%;
  background-color: transparent;
  backdrop-filter: blur(10px);
  padding: 50px 0;
  color: #fff;
  font-size: 24px;
  line-height: 32px;
  opacity: 0;
  pointer-events: none;
  transition: all 0.45s ease;
  transform: translateY(-100%);

  &.active {
    opacity: 1;
    pointer-events: all;
    transform: translateY(0);
    background: rgba(67, 45, 47, 0.8);
    z-index: 110;

    + .gallery_slider_close {
      display: block;
    }
  }

  strong {
    font-weight: 700;
  }

  &_item {
    max-width: 56%;
    margin: 0 auto;

    &_wrapper {
      overflow: scroll;
    }

    &_img {
      margin-bottom: 30px;

      img {
        width: 100%;
        height: 65vh;
        min-height: 400px;
        margin: 0 auto;
        object-fit: contain;

        @include for-laptop {
          height: 50vh;
        }

        @include for-phone {
          max-height: 320px;
          min-height: auto;
          height: auto;
        }
      }

      @include for-phone {
        margin-bottom: 15px;
      }
    }

    &_info {
      position: relative;
      padding-right: 170px;

      > div:first-child * {
        margin-bottom: 12px;
      }

      @include for-phone {
        display: flex;
        flex-direction: column-reverse;
        padding: 0;
      }
    }

    &_status {
      display: block;
      min-width: 145px;
      background-color: #fff;
      color: $primary-color;
      font-size: 18px;
      line-height: 31px;
      position: absolute;
      top: 0;
      right: 0;
      text-align: center;

      @include for-phone {
        position: static;
      }
    }

    &_additional {
      @include for-phone {
        display: flex;
        justify-content: space-between;
        align-items: center;
        margin-bottom: 15px;
      }
    }

    &_contact {
      font-family: $secondary-font;
      font-weight: 400;
      font-size: 40px;
      line-height: 48px;
      text-align: center;
      margin: 30px 0 50px;

      a {
        color: #fff;
        position: relative;

        &::after {
          content: '';
          width: 100%;
          height: 2px;
          background-color: #fff;
          position: absolute;
          left: 0;
          bottom: 3px;
          transition: all 0.35s ease;
        }
      }

      @include for-phone {
        margin: 20px 0 30px;
      }
    }

    @include for-laptop {
      max-width: 80%;
    }

    @include for-phone {
      max-width: 100%;
    }
  }

  .slick-arrow {
    position: absolute;
    top: 50%;
    transform: translateY(-50%);
    z-index: 1;
    &.slick-prev {
      left: 8%;
      @include for-laptop {
        left: 3%;
      }
    }
    &.slick-next {
      right: 8%;
      @include for-laptop {
        right: 3%;
      }
    }

    @include for-phone {
      width: 100%;
      display: none !important;
    }
  }

  .slick-clone-btn {
    display: none;

    @include for-phone {
      display: flex;
      align-items: center;
      width: 25px;
      height: 35px;
    }
  }

  .slick-slide {
    outline: none;
  }

  .slick-list, .slick-track {
    height: 100%;
  }

  &_close {
    position: fixed;
    top: 46px;
    right: 46px;
    display: none;
    z-index: 300;

    @include for-laptop {
      top: 25px;
      right: 25px;
    }
  }

  @include for-tablet {
    font-size: 18px;
    line-height: 26px;
  }

  @include for-phone {
    padding: 72px 20px 0;

    .slick-list {margin: 0 -10px;}
    .slick-slide>div {padding: 0 10px;}
  }
}

