    display: flex;
    justify-content: space-between;
    align-items: flex-start;

    @include for-tablet {
      flex-direction: column;
    }
  }

  &_info {
    max-width: 658px;
    padding-right: 20px;
    h4 {
      font-family: $secondary-font;
      font-weight: 400;
      font-size: 50px;
      line-height: 60px;
      margin-bottom: 20px;

      @include for-phone {
        font-size: 30px;
        line-height: 36px;
        margin-bottom: 15px;
      }
    }
    p {
      font-size: 23px;
      line-height: 39px;

      @include for-phone {
        font-size: 18px;
        line-height: 31px;
      }
    }

    svg {
      margin-right: 10px;
    }

    &_item {
      margin-bottom: 60px;

      &:not(.showed) {
        opacity: 0;
      }

      &.showed {
        animation: showItem 1s 0.5s ease both;
      }

      @include for-phone {
        margin-bottom: 40px;
      }
    }

    span {
      margin-right: 32px;

      &:last-child {
        margin-right: 0;
      }

      @include for-phone {
        margin-right: 20px;
      }
    }

    &_social {
      max-width: 470px;
      display: flex;
      justify-content: center;
      align-items: center;
      height: 77px;
      background-color: rgba(255,255,255,0.2);
      font-size: 23px;
      line-height: 39px;

      &:not(.showed) {
        opacity: 0;
      }

      &.showed {
        animation: showItem 1s 0.5s ease both;
      }

      svg {
        margin-left: 34px;
        position: relative;
        top: 2px;
        @include for-phone {
          margin-left: 18px;
          max-width: 115px;
          margin-right: 0;
        }
      }

      path {
        transition: all 0.35s ease;
      }

      &:hover {
        svg, path {
          fill: #fff;
        }
      }

      @include for-tablet {
        max-width: 100%;
      }

      @include for-phone {
        font-size: 18px;
        line-height: 31px;
        height: 70px;
      }
    }

    @include for-laptop {
      width: 50%;
    }

    @include for-tablet {
      max-width: 100%;
      width: 100%;
      padding-right: 0;
      margin-bottom: 40px;
    }
  }

  &_form {
    max-width: 795px;
    width: 100%;
    flex-shrink: 0;
    background-color: #C1C1B5;
    padding: 50px 192px 60px;
    position: relative;

    &:not(.showed) {
      opacity: 0;
    }

    &.showed {
      animation: showItem 1s 0.5s ease both;
    }

    &_headline {
      font-family: $secondary-font;
      font-weight: 400;
      font-size: 50px;
      line-height: 60px;
      text-align: center;
      margin-bottom: 24px;

      @include for-phone {
        font-size: 30px;
        line-height: 36px;
        margin-bottom: 12px;
      }
    }

    &_submit {
      display: block;
      margin: 35px auto 0;
      font-family: $secondary-font;
      font-weight: 400;
      font-size: 40px;
      line-height: 48px;
      position: relative;

      &::after {
        content: '';
        position: absolute;
        bottom: 3px;
        left: 0;
        width: 100%;
        height: 1px;
        background-color: $primary-color;
        transition: all 0.35s ease;
      }

      &:hover {
        &::after {
          background-color: #fff;
        }
      }

      @include for-phone {
        font-size: 28px;
        line-height: 34px;
        margin-top: 28px;
      }
    }

    &_thanks {
      position: absolute;
      top: 0;
      right: 0;
      bottom: 0;
      left: 0;
      z-index: 1;
      background-color: #C1C1B5;
      display: flex;
      justify-content: center;
      align-items: center;
      transition: all 0.7s ease;
      opacity: 0;
      pointer-events: none;

      &.active {
        opacity: 1;
      }

      p {
        max-width: 523px;
        font-family: $secondary-font;
        font-weight: 400;
        font-size: 50px;
        line-height: 60px;
        text-align: center;

        @include for-phone {
          max-width: 232px;
          font-size: 30px;
          line-height: 36px;
        }
      }
    }

    @include for-laptop {
      width: 50%;
      padding: 50px 90px;
    }

    @include for-tablet {
      width: 100%;
      max-width: 100%;
      padding: 40px;
    }

    .wpcf7-response-output {
      display: none;
    }
  }

  @include for-phone {
    padding: 20px 0;
  }
}
